export function getCompanyMaterials(companyId) {
    const materials = [];
    const companyData = SCRAPED_MATERIALS[companyId];
    if (companyData) {
        Object.values(companyData).forEach(categoryMaterials => {
            materials.push(...categoryMaterials);
        });
    }
    return materials;
}

// Helper function to search materials by name
export function searchMaterials(query, companyId = null) {
    const results = [];
    const companies = companyId ? [companyId] : Object.keys(SCRAPED_MATERIALS);
    
    companies.forEach(company => {
        const companyMaterials = getCompanyMaterials(company);
        companyMaterials.forEach(material => {
            if (material.name.toLowerCase().includes(query.toLowerCase())) {
                results.push(material);
            }
        });
    });
    
    return results;
}

// Helper function to get available lengths for a dimension
export function getAvailableLengths(dimension, companyId = null) {
    const lengths = new Set();
    const companies = companyId ? [companyId] : Object.keys(SCRAPED_MATERIALS);
    
    companies.forEach(company => {
        const companyMaterials = getCompanyMaterials(company);
        companyMaterials.forEach(material => {
            if (material.dimension === dimension && material.length) {
                lengths.add(material.length);
            }
        });
    });
    
    return Array.from(lengths).sort((a, b) => a - b);
}

// Helper function to get materials by dimension and length
export function getMaterialsByDimensionAndLength(dimension, length, companyId = null) {
    const results = [];
    const companies = companyId ? [companyId] : Object.keys(SCRAPED_MATERIALS);
    
    companies.forEach(company => {
        const companyMaterials = getCompanyMaterials(company);
        companyMaterials.forEach(material => {
            if (material.dimension === dimension && material.length === length) {
                results.push(material);
            }
        });
    });
    
    return results;
}
